/**
 * Represents a title of a section of our CV
 * 
 * props.title -> title of our section
 */

import {Container} from 'react-bootstrap';

function SectionTitle(props){
   return ( 
    <Container>
        <h2 className="Tagline">{props.title}</h2>
        <hr />
    </Container>);
} export default SectionTitle;
